int main(void)
{
  int i, j, n, s, t, q[NMAX];
  double A[NMAX][NMAX], B[NMAX];
  while (scanf("%d %d %d", &n, &s, &t), (n != 0 && s != 0 && t != 0)) {
    s--;
    t--;
    for (i = 0; i < n; i++) scanf ("%d", &q[i]);
    for (i = 0; i < n; i++) {
      len[i] = 0;
      for (j = 0; j < n; j++) {
        int temp;
        A[i][j] = 0;
        scanf("%d", &temp);
        if (temp) {
          list[i][len[i]].id = j;
          list[i][len[i]++].weight = temp;
        }
      }
      A[i][i] = 1.0;
      B[i] = 0;
    }
    dijkstra(t, n);
    if (dist[s] == INF) {
      printf("impossible\n");
      continue;
    }
    for (i = 0; i < n; i++) {
      int move = 0, sum = 0;
      if (i == t) continue;
      else if (q[i] == 1) {
        int best = INF;
        for (j = 0; j < len[i]; j++) best = min(best, list[i][j].weight + dist[list[i][j].id]);
        if (best == INF) continue;
        for (j = 0; j < len[i]; j++) {
          if (best == list[i][j].weight + dist[list[i][j].id]) {
            move++;
            A[i][list[i][j].id] = -1;
            sum += list[i][j].weight;
          }
        }
        A[i][i] = move;
        B[i] = sum;
      } else {
        move = len[i];
        A[i][i] = move;
        if (move == 0) continue;
        for (j = 0; j < len[i]; j++) {
          A[i][list[i][j].id] = -1;
          sum += list[i][j].weight;
        }
        B[i] = sum;
      }
    }
    gauss_jordan(A, B, n);
    printf("%.15f\n", B[s]);
  }
}
